import React from 'react'
import styled from "@emotion/styled";

const Container = styled.div`
    display: flex;
    justify-content: center;
    color: #DAFFEF;
    text-shadow: 1px 1px #64B6AC;
`

const Header = () => {
    return (
        <Container>
            <h2>Emoji Picker 🍒</h2>
        </Container>
    );
}

export default Header;
